import Navbar from '../components/Navbar';
import HeroImage from '../components/HeroImage';
import Footer from '../components/Footer';

const Home = () => {
  return (
    <div>
      <Navbar />
      <HeroImage />
      <Work/>
      <Footer />
    </div>
  )
}

export default Home;
